import Vue from 'vue'
import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import 'bootstrap/dist/css/bootstrap.css'
import 'bootstrap-vue/dist/bootstrap-vue.css'
import axios from "axios";
import store from "@/store/store";
import session_expired_handler from "@/utilities/session_expired_handler";
import {VuesaxUIComponent} from "vuesax/types/component";



axios.defaults.baseURL = 'http://localhost:8082/demo1_war_exploded/'
axios.defaults.withCredentials = true

createApp(App).use(router).use(store).use(session_expired_handler).mount('#app')
